import React from 'react'
import homeimg from '../images/homeimg.png'

export default function HomePage() {
  return (
    <React.Fragment>
        <div className='homePageContainer'>
        <img src={homeimg} alt='home image'/>
        </div>
    </React.Fragment>
  )
}
